import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';

let User =()=>
<span className="card " style={{width: 180 }}>
  <img src="https://picsum.photos/200" className="card-img-center m-100"></img>
  <div className="card-body">
  <h5 className="card-text">Lissa</h5>
  </div>
</span>

let OwesMe =()=>
<div className="badge badge-pill badge-success m-2 p-2">Summ</div>

let OweTo =()=>
<div className="badge badge-pill badge-danger m-2 p-2">-Summ</div>

let Money =()=>
<div >
    <OwesMe />
    <OweTo />
</div>

class App extends Component {
    state = {  }
    render() { 
        return (  
        <div>
            <User />
            <Money />
        </div> );
    }
}

export default App;
